from fastapi.testclient import TestClient
from app.main import app
import json

client = TestClient(app)

def test_calc_para():
    request_data = {
        "base64_image": "",
        "whole_hight_mm": 138
    }

    response = client.post(
        "/calc_para/",
        json=request_data
    )

    assert response.status_code == 200
    response_data = response.json()

    assert response_data["height"] >= 0
    assert response_data["width"] >= 0
    assert response_data["scale_ratio"] >= 0
    assert "perimages" in response_data

    for _, value in response_data["perimages"].items():
        assert value["width"] >= 0
        assert value["area"] >= 0
        assert value["peri"] >= 0
        assert value["x"] >= 0
        assert value["y"] >= 0
        assert value["skeleton_length"] >= 0
        assert value["intersection_count3"] >= 0
        assert value["intersection_count4"] >= 0
        assert value["intersection_count5"] >= 0
        assert value["intersection_count6"] >= 0
        assert value["endpoints_count"] >= 0
        # assert "surface" in value
        # assert value["surface"]["more_squeeze"] >= 0
        # assert value["surface"]["squeeze"] >= 0
        # assert value["surface"]["nomal"] >= 0

